
// 开放调用的 api 方法列表
var apiMethods = [
  'close',
  'download',
  'getSourceMap'
];

var iframeApi = new IframeApi({
  'hello': function (name) {
    return Promise.resolve('Hello ' + name);
  },
  'getSourceMap': function () {
    return Promise.resolve({
      "main": "index.html",
      "files": [],
      "images": {
        "c_back.jpg": "data:image/jpg;base64,",
        "c_bottom.jpg": "data:image/jpg;base64,",
        "c_front.jpg": "data:image/jpg;base64,",
        "c_left.jpg": "data:image/jpg;base64,",
        "c_right.jpg": "data:image/jpg;base64,",
        "c_top.jpg": "data:image/jpg;base64,"
      }
    });
  }
});
var bridge = new IframeBridge();
var server = new IframeInvocationServer(bridge, iframeApi);

var iframeId = 'test-iframe-gen';
var $ = function (id) {
  return document.getElementById(id);
};

$('btnLoadIFrame').addEventListener('click', function () {
  
  loadFrame(iframeId, '../../dist/index.html?id=' + iframeId);

  setTimeout(function () {
    server.invoke(iframeId, 'render');
  }, 2000);
}, false)

function loadFrame(id, url) {
  var iframe = document.createElement('iframe');
  iframe.id = id;
  iframe.src = url;
  iframe.className = 'iframe';
  document.body.appendChild(iframe);
}


